import React from "react";

const ContactForm = () =>{
    return(
        <form>
            <div className="form_div">
            <input type="text" placeholder="Your Name*" required className="name"/>
            <input type="email" placeholder="Email Address*" required  className="email"/>

            </div>

            <input type="text" placeholder="Subject*" required className="subject"/> <br/>
            <input type="text" placeholder="Message*" required  className="message"/> <br/>

            <div className="btn">
            <button>Send Now <i class="fa-solid fa-paper-plane"></i></button>
            </div>
        </form>

    )
}

export default ContactForm;
